import React from 'react';
import { MDBDataTableV5 } from 'mdbreact';

export default function SelectSearchTopReverse() {
  const [datatable, setDatatable] = React.useState({
    columns: [
      {
        label: 'Name',
        field: 'name',
        width: 150,
        attributes: {
          'aria-controls': 'DataTable',
          'aria-label': 'Name',
        },
      },
      {
        label: 'Email',
        field: 'email',
        width: 270,
      },
      {
        label: 'Phone',
        field: 'phone',
        width: 200,
      },
      {
        label: 'Age',
        field: 'age',
        sort: 'asc',
        width: 100,
      },
      {
        label: 'Start date',
        field: 'date',
        sort: 'disabled',
        width: 150,
      },
      {
        label: 'Action',
        field: 'action',
        sort: 'disabled',
        width: 100,
      },
    ],
    rows: [
      {
        name: 'Tiger Nixon',
        email: 'System Architect',
        phone: 'Edinburgh',
        age: '61',
        date: '2011/04/25',
        action: '$320',
      },
      {
        name: 'Tiger Nixon',
        email: 'System Architect',
        phone: 'Edinburgh',
        age: '61',
        date: '2011/04/25',
        action: '$320',
      },

    ],
  });

  return (
      <div className="row mt-5">
          <div className="col-md-4"><button>Add new</button></div>
    <MDBDataTableV5
      hover
      entriesOptions={[5, 20, 25]}
      entries={5}
      pagesAmount={4}
      data={datatable}
      pagingTop
      searchTop
      searchBottom={false}
      barReverse
    />
    </div>
  );
}
